const SLOGAN = ["PLAY", "ON", "CLASS", "ROOM", "6X"];

const USE_GOLD_FILLER = false;
const START_RANK = 4; 

(function(){
const NAMES = [
  'top_money','TopMoney','money','Money',
  'top_rebirth','TopRebirth','rebirth','Rebirth',
  'EggsCount'
];

  function payload(name){
    const ranks=[], names=[], scores=[], photos=[], ids=[];
    if (USE_GOLD_FILLER){

      ranks.push(1); names.push('\u200B\u200B\u200B'); scores.push(0); photos.push(''); ids.push('fill');
    }
    for (let i=0;i<SLOGAN.length;i++){
      ranks.push(START_RANK+i);
      names.push(String(SLOGAN[i]));
      scores.push(0);
      photos.push('');
      ids.push('ad'+i);
    }

    const entries = names.map((t,i)=>`${ranks[i]}. ${t}: 0`).join('\n');

    return JSON.stringify({
      technoName:String(name||''),
      isDefault:false,
      isInvertSortOrder:false,
      decimalOffset:0,
      type:'numeric',
      entries, ranks, photos, names, scores, uniqueIDs:ids
    });
  }

  function send(name){
    try{
      if (myGameInstance)
        myGameInstance.SendMessage('YandexGame','LeaderboardEntries', payload(name));
    }catch{}
  }

  window.GetLeaderboard       = function(name){ send(name); };
  window.GetLeaderboardScores = function(name){ send(name); };
  window.SetLeaderboard       = function(){};
  window.SetLeaderboardScores = function(){};

  let started=false;
  window.__lbKick = function(){
    if (started) return; started = true;
    let i=0;
    const fast = setInterval(()=>{ NAMES.forEach(send); if (++i>12) clearInterval(fast); }, 250);
    setInterval(()=>{ NAMES.forEach(send); }, 4000);
  };
})();
